(7, 'YZMTz2aWGoc', 'Entomologists vacuum Asian giant hornets out of nest found in Whatcom County', 'The first Asian giant hornet nest found in the United States appears to have been successfully removed from a tree in Whatcom County, according to the Washington State Department of Agriculture (WSDA). \r\n\r\nHeavily protected crews with WSDA worked to eradicate the nest early Saturday morning. The nest was first discovered Thursday in a tree cavity, about eight feet up, on private property in Blaine. The property owner gave WSDA permission for the nest to be eradicated and for staff to remove the tree if necessary. \r\n\r\nLearn more: https://www.king5.com/article/tech/science/environment/entomologists-safely-remove-first-asian-giant-hornet-nest-found-in-us-in-whatcom-county/281-681e736b-5af2-4101-8a7b-0d2feb6db982', '{\"default\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/YZMTz2aWGoc\\/default.jpg\",\"width\":120,\"height\":90},\"medium\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/YZMTz2aWGoc\\/mqdefault.jpg\",\"width\":320,\"height\":180},\"high\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/YZMTz2aWGoc\\/hqdefault.jpg\",\"width\":480,\"height\":360},\"standard\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/YZMTz2aWGoc\\/sddefault.jpg\",\"width\":640,\"height\":480},\"maxres\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/YZMTz2aWGoc\\/maxresdefault.jpg\",\"width\":1280,\"height\":720}}', 'UCp1KrVaZDZ7BOI_QBuTWWmg', 'KING 5', 'The first Asian giant hornet nest found in the United States appears to have been successfully removed from a tree in Whatcom County, according to the Washington State Department of Agriculture (WSDA). \r\n\r\nHeavily protected crews with WSDA worked to eradicate the nest early Saturday morning. The nest was first discovered Thursday in a tree cavity, about eight feet up, on private property in Blaine. The property owner gave WSDA permission for the nest to be eradicated and for staff to remove the tree if necessary. \r\n\r\nLearn more: https://www.king