(15, '2exsQ-1Cuh0', 'UFC 254 Recap: Khabib stops Justin Gaethje to retain title, announces retirement | CBS Sports HQ', 'Justin Gaethje followed through with his gameplan against lightweight champion Khabib Nurmagomedov in the main event of UFC 254. Unfortunately for Gaethje, a good gameplan wasn\'t enough to beat a perfect fighter. Nurmagomedov scored a win with a second-round submission, unifying his lightweight title with Gaethje\'s interim championship.\n\nGaethje said leading up to the fight that he just needed to land solid kicks to the legs of Nurmagomedov to take away the champ\'s wrestling game and open him up to the challenger\'s huge power punches. The kicks did land, and Nurmagomedov\'s legs did seem to be starting to show some damage, but it only takes one moment for Nurmagomedov to put an opponent in a bad position.\n\nAfter a second-round leg kick from Gaethje, Nurmagomedov drove through a takedown and quickly moved to mount. After locking in a triangle choke, Nurmagomedov rolled to his back and squeezed the choke while Gaethje tapped out. Gaethje\'s taps were missed by the referee, leaving the challenger unconscious on the canvas.\n\nFollowing the fight, Nurmagomedov announced his retirement, stating he didn\'t want to return to the Octagon without his father, who died following COVID-19-related complications earlier this year.\n\nSUBSCRIBE TO OUR CHANNEL:\nhttps://www.youtube.com/user/CBSSportsHQ\n \nFOLLOW US ON:\nFacebook - https://www.facebook.com/CBSSports/\nInstagram - https://www.instagram.com/cbssports/\nTwitter - https://twitter.com/CBSSports\n\n#UFC #UFC245 #Khabib #JustinGaethje #MMA #Nurmagomedov #khabibNurmagomedov #FigtIsland', '{\"default\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/2exsQ-1Cuh0\\/default.jpg\",\"width\":120,\"height\":90},\"medium\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/2exsQ-1Cuh0\\/mqdefault.jpg\",\"width\":320,\"height\":180},\"high\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/2exsQ-1Cuh0\\/hqdefault.jpg\",\"width\":480,\"height\":360},\"standard\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/2exsQ-1Cuh0\\/sddefault.jpg\",\"width\":640,\"height\":480},\"maxres\":{\"url\":\"https:\\/\\/i.ytimg.com\\/vi\\/2exsQ-1Cuh0\\/maxresdefault.jpg\",\"width\":1280,\"height\":720}}', 'UCja8sZ2T4ylIqjggA1Zuukg', 'CBS Sports HQ', 'Justin Gaethje followed through with his gameplan against lightweight champion Khabib Nurmagomedov in the main event of UFC 254. Unfortunately for Gaethje, a good gameplan wasn\'t enough to beat a perfect fighter. Nurmagomedov scored a win with a second-round submission, unifying his lightweight title with Gaethje\'s interim championship.\n\nGaethje said leading up to the fight that he just needed to land solid kicks to the legs of Nurmagomedov to take away the champ\'s wrestling game and open him up to the challenger\'s huge power punches. The kicks did land, and Nurmagomedov\'s legs did seem to be starting to show some damage, but it only takes one moment for Nurmagomedov to put an opponent in a bad position.\n\nAfter a second-round leg kick from Gaethje, Nurmagomedov drove through a takedown and quickly moved to mount. After locking in a triangle choke, Nurmagomedov rolled to his back and squeezed the choke while Gaethje tapped out. Gaethje\'s taps were missed by the referee, leaving the challenger unconscious on the canvas.\n\nFollowing the fight, Nurmagomedov announced his retirement, stating he didn\'t want to return to the Octagon without his father, who died following COVID-19-related complications earlier this year.\n\nSUBSCRIBE TO OUR CHANNEL:\nhttps://www.youtube.com/user/CBSSportsHQ\n \nFOLLOW US ON:\nFacebook - https://www.facebook.com/CBSSports/\nInstagram - https://www.instagram.com/cbssports/\nTwitter - https://twitter.com/CBSSports\n\n#UFC #UFC245 #Khabib #JustinGaethje #MMA #Nurmagomedov #khabibNurmagomedov #FigtIsland', '', 'https://www.youtube.com/watch?v=2exsQ-1Cuh0', '2020-10-25 17:42:10', '2020-10-25 17:42:10'),
